import React, { Component } from "react";
import { Link } from "react-router-dom";

class Portfolio extends Component {
    render() {
        return (
            <div>
                <iframe title = "my frame" id = "fullframe" src="./portfolio/index.html" ></iframe>
            </div>
        );
    }
}

export default Portfolio;
